class ValidationRules:
    def __init__(self):
        self.rules = {}

    def update_rule(self, rule_name, rule_value):
        self.rules[rule_name] = rule_value
        print(f"Validation rule '{rule_name}' updated to '{rule_value}'.")


class DFileGenerationRequest:
    def __init__(self):
        self.requests = []

    def create_request(self, request_data):
        self.requests.append(request_data)
        print("D File generation request created:", request_data)

    def process_requests(self):
        for request in self.requests:
            print("Processing D File request:", request)


class ErrorTrigger:
    def __init__(self):
        self.triggers = {}

    def add_trigger(self, error_code, description):
        self.triggers[error_code] = description
        print(f"Error trigger '{error_code}' added with description '{description}'.")

    def get_trigger_description(self, error_code):
        return self.triggers.get(error_code, "Error code not found.")


