class SystemMaintenance:
    def __init__(self):
        self.records = []

    def process_deletions(self, date):
        before_deletion = len(self.records)
        self.records = [record for record in self.records if record['date'] != date]
        after_deletion = len(self.records)
        print(f"Processed deletions for date {date}. {before_deletion - after_deletion} records removed.")


